def debug(msg: str):
    """Write a message to both OBS log and stdout for easy troubleshooting."""
    tagged = f"[ReplayGameInfo] {msg}"
    print(tagged)
    try:
        obs.script_log(obs.LOG_INFO, tagged)
    except Exception:
        # obs might not be initialized yet (during module import)
        pass


